const AboutPage = () => {
    return(
        <>
            <h1>About Me</h1>
            <p>
                Suspendisse et sagittis mauris. Sed pharetra arcu ac quam vestibulum rutrum. Fusce vestibulum nulla augue, et sagittis mauris rhoncus ut. Suspendisse sollicitudin vitae felis quis sagittis. Duis egestas dignissim justo eget dapibus. Mauris porta vel massa id porta. Donec venenatis odio eget viverra maximus. Vivamus fermentum elementum nisl, sit amet elementum sapien cursus quis.
            </p>
            <p>
                Aenean feugiat mi malesuada urna pulvinar iaculis. Maecenas at pharetra felis. Sed hendrerit eget purus eu vulputate. Suspendisse fringilla maximus diam, vel luctus turpis convallis vel. Fusce ligula diam, hendrerit sed libero ac, commodo gravida nunc. Praesent eros est, condimentum in sodales sed, consequat eget ipsum. Nullam pharetra nulla neque, vitae cursus turpis aliquet at. Pellentesque ut dui vel mauris posuere suscipit. Vestibulum eget quam dui. Morbi nec dolor at elit lobortis malesuada. Sed posuere aliquam vulputate. Sed eu nibh blandit, sollicitudin ex in, iaculis lectus.
            </p>
            <p>
                Curabitur nec fringilla mauris, in placerat nibh. Vivamus imperdiet enim vitae lacinia maximus. Pellentesque cursus, velit sed consectetur gravida, justo nisi fringilla felis, et feugiat sem ex eu dolor. Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Fusce in ipsum non dui commodo scelerisque at id turpis. Curabitur id tellus posuere, malesuada metus ut, molestie tortor. Nullam sem dui, ullamcorper quis tortor eu, maximus fringilla diam. Ut sodales maximus sapien, quis tincidunt urna dignissim quis. Nam a auctor lacus. Donec convallis, magna ac tincidunt luctus, mauris nulla pretium leo, non finibus nibh sapien a neque. Cras est elit, sagittis sed porta sit amet, scelerisque at enim. Vivamus eget commodo ligula. Praesent vestibulum tellus ante, eget varius est congue id. Nullam orci nunc, semper ac tellus vel, placerat dictum augue.
            </p>
        </>
    );
}

export default AboutPage;
